const Intro = () => {
  return (
    <div className="intro flex" id='intro'>
      <div className="left">
        <div className="imgContainer">
          <img src="assets/man.png" className="image-man" />
        </div>
      </div>
      <div className="right">
        dfghjk
      </div>
    </div>
  )
}

export default Intro;
